import axios from 'axios'

export default class World {
    constructor(){
	state = {
	preset: []
    }

    }


    componentDidMount(){
	this.getPreset();
    }

    getPreset() {
	axios
	    .get('http://127.0.0.1:8000/api/worlds/1/')
	    .then(res => {
		this.setState(() => ({
		    preset: res.data.preset
		}));
		// console.log(res.data.preset);
	    }).catch(err => {
		console.log(err);
	    });
    }
}
